import React from "react";
import ReactDOM from "react-dom";

//import App from './App';
import Home from "./Home/Home";


import {BrowserRouter, Route, Switch} from "react-router-dom";


       
ReactDOM.render(


<BrowserRouter>
<Switch>

  <Route path ="/" component = {Home} />
</Switch>
   


</BrowserRouter>
,
document.getElementById("root")
);
